import './App.css';
import WeatherTile from './WeatherTile'

function App() {
  let weatherData;
  fetch('http://api.weatherapi.com/v1/forecast.json?key=6018bc6ca5bb4a4884c184418202812&q=Winnipeg&days=5')
  .then(response => response.json())
  .then(json => {
    let wd = json.forecast.forecastday
    we1 = wd.map(data => {
      console.log(data)
      return <WeatherTile main={data.date} />
    })
    })
  return (
    <div className="App">
    { we1 }
    </div>
  );
}

export default App;
